import React from 'react';
import quotes from '../quotes.json'

const Quotebox = () => {
    return (
        <div id="fondo">
            <div id="tarjeta">
                <p>{quotes[0]}</p>
                <button id="boton"></button>
            </div>
        </div>
    );
};

export default Quotebox;
